If you must perform I/O in your library, then it cannot be synchronous. There is only asynchronous I/O on the Web. Use the futures crate and the wasm-bindgen-futures crate to manage asynchronous I/O. If your library functions are generic over some future type F, then that future can be implemented via fetch on the Web or via non-blocking I/O provided by the operating system. pub fn do_stuff<F>(future: F) -> impl Future<Item = MyOtherThing>
where F: Future<Item = MyThing>,
{ // ...
} You can also define a trait and implement it for WebAssembly and the Web and also for native targets: trait ReadMyThing { type F: Future<Item = MyThing>; fn read(&self) -> Self::F;
} #[cfg(target_arch = "wasm32")]
struct WebReadMyThing { // ...
} #[cfg(target_arch = "wasm32")]
impl ReadMyThing for WebReadMyThing { // ...
} #[cfg(not(target_arch = "wasm32"))]
struct NativeReadMyThing { // ...
} #[cfg(not(target_arch = "wasm32"))]
impl ReadMyThing for NativeReadMyThing { // ...
}

